import React from "react";
import {useState, useEffect} from 'react';
import {useDispatch, useSelector} from 'react-redux';
import { getCharacters, orderName } from "../action";
import {Link} from 'react-router-dom'
import Card from "./Card";
import Paginado from "./Paginado";

export default function Home(){

    const dispatch = useDispatch()
    const allCharacters = useSelector((state) => state.characters)
    const [orden, setOrden] = useState('')
  const [currentPage, setCurrentPage] = useState(1)
  const [charactersPerPage] = useState(6)
  const indexOfLastCharacters =
    currentPage === 1 ? 6 :  currentPage * charactersPerPage;
  const indexFirstCharacters = 
  currentPage === 1 ? 0 : indexOfLastCharacters - charactersPerPage;
  const currentCharacters = allCharacters.slice(indexFirstCharacters, indexOfLastCharacters);


  const paginado = (pageNumber) => {
    setCurrentPage(pageNumber)
  }

    useEffect(() => {
        dispatch(getCharacters())
    },[dispatch])

    function handleClick(e){
     e.preventDefault();
     dispatch(getCharacters());
    }
    function handleName(e){
      e.preventDefault()
      dispatch(orderName(e.target.value))
      setCurrentPage(1)
      setOrden(e.target.value)
    }



    return(
        <div>
            <Link to= '/characters'>Crear personaje</Link>
           <button onClick={e => {handleClick(e)}}>Volver</button>
            <div>
                <select onChange={e => handleName(e)}>
                    <option>Order abc</option>
                    <option value= 'asc'>Ascendente a-z</option>
                    <option value= 'desc'>Descendente z-a</option>
                </select>
                 <select>
                    <option value = 'All'>Todos</option>
                    <option value = 'created'>creados</option>
                    <option value = 'api'>Existente</option>
                 </select>
                 <select>
                    <option value = 'All'>Family</option>
                    <option value = 'created'>Targaryen</option>
                    <option value = 'api'>Tarly</option>
                    <option value = 'api'>Stark</option>
                    <option value = 'api'>Baratheon</option>
                    <option value = 'api'>Lannister</option>
                    <option value = 'api'>Greyjoy</option>
                    <option value = 'api'>Clegane</option>
                    <option value = 'api'>Baelish</option>
                    <option value = 'api'>Seaworth</option>
                    <option value = 'api'>Tyrell</option>
                    <option value = 'api'>Free Folk</option>
                    <option value = 'api'>Tarth</option>
                    <option value = 'api'>Naathi</option>
                    <option value = 'api'>Bolton</option>
                    <option value = 'api'>Naharis</option>
                    <option value = 'api'>Lorathi</option>
                    <option value = 'api'>Mormont</option>
                    <option value = 'api'>Sparrow</option>
                    <option value = 'api'>Viper</option>
                    <option value = 'api'>Lorath</option>
                    <option value = 'api'>Sand</option>
                    <option value = 'api'>Worm</option>
                    <option value = 'api'>Qyburn</option>
                    <option value = 'api'>Bronn</option>
                    <option value = 'api'>Unknown</option>
                 </select>


      <Paginado
      currentPage = {currentPage}
      charactersPerPage = {charactersPerPage}
      allCharacters = {allCharacters.length}
      paginado = {paginado} 

      />

                 {
                 currentCharacters?.map((el) => {
                 return(
                  <Link key= {el.id} to = {'/home/'+ el.id}>
                    <Card   

                    fullname={el.fullname}
                    title={el.title} 
                    family={el.family} 
                    imageUrl={el.imageUrl}
                   />
                 </Link>

                )
                })
             }    
        </div>
        </div>
    )
}
